using FileUploadService.Models;
using FileUploadService.Services;

namespace UniTest;

[TestClass]
public class UnitTest1
{
    private readonly IUploadServcie _uploadServcie;
    public UnitTest1(IUploadServcie uploadServcie)
    {
        _uploadServcie = uploadServcie;
    }
    [TestMethod]
    public async void UploadFile_ShouldSucceed()
    {
        var upload = new UploadFileModel
        {
            Folder = "Image",
            Image = "",
            Name = $"Example_{DateTime.Now.ToString("ddMMyyyyHHmmmi")}"
        };
        var emailService = await _uploadServcie.PostImage(upload);

        Assert.AreNotEqual(null, emailService);
      
    }
}
